import React from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation } from 'react-router-dom';

function DebugInfo() {
  const location = useLocation();
  return (
    <div className="bg-yellow-100 border border-yellow-300 p-4 m-4 rounded">
      <h3 className="font-bold text-yellow-800">Debug Info:</h3>
      <p className="text-yellow-700">Current pathname: {location.pathname}</p>
      <p className="text-yellow-700">Current search: {location.search}</p>
      <p className="text-yellow-700">Current hash: {location.hash}</p>
    </div>
  );
}

function HomePage() {
  return (
    <div className="p-8">
      <DebugInfo />
      <h1 className="text-3xl font-bold mb-4 text-blue-600">‚úÖ Home Page Works!</h1>
      <p className="mb-4 text-gray-600">The React app is successfully loading and routing is working.</p>
      <div className="space-y-2">
        <a href="/color-search" className="block text-blue-500 underline hover:text-blue-700">
          üé® Go to Color Search (href)
        </a>
        <a href="/test" className="block text-green-500 underline hover:text-green-700">
          üß™ Go to Test Page (href)
        </a>
        <a href="/nonexistent" className="block text-red-500 underline hover:text-red-700">
          ‚ùå Go to Non-existent Page (should show Page Not Found)
        </a>
      </div>
    </div>
  );
}

function SimpleColorTest() {
  return (
    <div className="p-8">
      <DebugInfo />
      <h1 className="text-3xl font-bold mb-4 text-purple-600">üé® Color Search Test Page</h1>
      <p className="mb-4 text-gray-600">This page confirms that routing to /color-search works!</p>
      <div className="grid grid-cols-4 gap-4 max-w-md mb-4">
        <div className="w-16 h-16 bg-red-500 rounded-lg"></div>
        <div className="w-16 h-16 bg-blue-500 rounded-lg"></div>
        <div className="w-16 h-16 bg-green-500 rounded-lg"></div>
        <div className="w-16 h-16 bg-yellow-500 rounded-lg"></div>
        <div className="w-16 h-16 bg-purple-500 rounded-lg"></div>
        <div className="w-16 h-16 bg-pink-500 rounded-lg"></div>
        <div className="w-16 h-16 bg-indigo-500 rounded-lg"></div>
        <div className="w-16 h-16 bg-teal-500 rounded-lg"></div>
      </div>
      <a href="/" className="text-blue-500 underline">‚Üê Back to Home</a>
    </div>
  );
}

function TestPage() {
  return (
    <div className="p-8">
      <DebugInfo />
      <h1 className="text-3xl font-bold mb-4 text-green-600">üß™ Test Page Works!</h1>
      <p className="mb-4 text-gray-600">This confirms the /test route is working properly.</p>
      <a href="/" className="text-blue-500 underline">‚Üê Back to Home</a>
    </div>
  );
}

function NotFoundPage() {
  const location = useLocation();
  return (
    <div className="p-8">
      <DebugInfo />
      <h1 className="text-3xl font-bold mb-4 text-red-600">‚ùå Page Not Found</h1>
      <p className="mb-4 text-gray-600">
        The route <code className="bg-gray-200 px-2 py-1 rounded">{location.pathname}</code> doesn't match any of our defined routes.
      </p>
      <div className="mb-4">
        <h3 className="font-semibold mb-2">Available routes:</h3>
        <ul className="list-disc list-inside space-y-1 text-sm">
          <li><code>/</code> - Home page</li>
          <li><code>/color-search</code> - Color search page</li>
          <li><code>/test</code> - Test page</li>
        </ul>
      </div>
      <a href="/" className="text-blue-500 underline">‚Üê Go to Home</a>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        <div className="bg-white shadow-sm border-b mb-4">
          <div className="max-w-4xl mx-auto px-4 py-3">
            <h1 className="text-xl font-semibold text-gray-800">ChapterOne - Debug Mode</h1>
          </div>
        </div>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/color-search" element={<SimpleColorTest />} />
          <Route path="/test" element={<TestPage />} />
          <Route path="*" element={<NotFoundPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
